ユニブレード専用替えゴム！<br>★本体が樹脂カバーに覆われている新形状ワイパーブレード用です。<br><br><br>撥水コーティングガラスでも、ビビらず、静粛性に優れた拭きを実現する交換ゴム。<br>安全な視界を確保するために、ワイパーブレードのゴムは6ヵ月に1回の交換をお勧め致します。<br><br><br>●ガラスに撥水処理を施している車、施していない車にも対応<br>●グラファイト+モリブデン粒子により、摩擦抵抗を大幅に低減<br>●シャープなゴムエッジが雨をスパっと拭き取る<br><br>車種別の適合についてはPIAAホームページにてご確認ください。<br><br>*本製品には金属レールは付属しておりません。純正の金属レールをご使用ください。<br><br><br>■仕様<br>品名：スーパーグラファイト替えゴム（ユニブレード専用）<br>品番：WLW55<br>呼番：95<br>メーカー：PIAA<br>サイズ：550mm<style type="text/css">
