ユニブレード専用替えゴム！<br>★本体が樹脂カバーに覆われている新形状ワイパーブレード用です。<br><br><br>撥水コーティングガラスでも、ビビらず、静粛性に優れた拭きを実現する交換ゴム。<br>安全な視界を確保するために、ワイパーブレードのゴムは6ヵ月に1回の交換をお勧め致します。<br><br><br>●ワイパーを作動させるだけで撥水被膜を形成するシリコートゴム<br>●撥水処理を施しているガラスに使用した際、劣化した撥水被膜を修復することができ、撥水効果を長持ちさせる<br>（撥水処理を施していないガラスにも対応）<br>●グラファイト粒子をコーティング。不快なビビリを軽減し、スムーズな動作を得られる<br><br>車種別の適合についてはPIAAホームページにてご確認ください。<br><br>*本製品には金属レールは付属しておりません。純正の金属レールをご使用ください。<br><br><br>■仕様<br>品名：エクセルコート替えゴム（ユニブレード専用）<br>品番：ELR35<br>呼番：88<br>メーカー：PIAA<br>サイズ：350mm<style type="text/css">
